import React, { Component } from 'react'
import './Menu.scss'

export default class Menu extends Component {
  render() {
    return (
      <div className='Container__menu-wrapper'>
        <ul className='Container__menu-categories'>
          <li className='category'>Culpa</li>
          <li className='category'>Duis</li>
          <li className='category'>In</li>
          <li className='category'>Reprehenderit</li>
          <li className='category'>Enim</li>
          <li className='category'>Irure</li>
        </ul>
      </div>
    )
  }
}
